require.config({"config": {
        "text":{"Magento_InventoryInStorePickupFrontend/template/store-selector/popup-item.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<tr class=\"row location\">\n    <td class=\"col col-location-details location-details\">\n        <p class=\"location-name\">\n            <text args=\"location.name\"></text>\n        </p>\n        <p class=\"location-address\">\n            <text args=\"location.street\"></text><br/>\n            <text args=\"location.city\"></text>, <span text=\"location.region\"></span> <text args=\"location.postcode\"></text><br/>\n            <text args=\"location.country\"></text><br/>\n            <a if=\"location.telephone\" attr=\"'href': 'tel:' + location.telephone\" text=\"location.telephone\"></a>\n        </p>\n        <!-- ko if: location.description -->\n            <!-- ko with: {locationDescriptionUnsanitizedHtml: location.description} -->\n                <p class=\"location-description\" html=\"locationDescriptionUnsanitizedHtml\"></p>\n            <!-- /ko -->\n        <!-- /ko -->\n    </td>\n    <td class=\"col col-location-actions\">\n        <div class=\"select-location\" ifnot=\"$parent.isPickupLocationSelected($data)\">\n            <button type=\"button\"\n                    class=\"action secondary action-select-shipping-item\"\n                    click=\"$parent.selectPickupLocation.bind($parent, $data)\">\n                <translate args=\"'Ship Here'\"></translate>\n            </button>\n        </div>\n        <div class=\"location-selected\" if=\"$parent.isPickupLocationSelected($data)\">\n            <button type=\"button\" class=\"action secondary\" disabled>\n                <span translate=\"'Selected'\"></span>\n            </button>\n        </div>\n    </td>\n</tr>\n"}
}});
